(5, 'C:/cygwin/var/spool/sms/incoming/GSM1.0A5jO0', '628124437651', '2010-12-25 05:22:37', '2011-01-11 21:40:23', 0, ' SELAMAT NATAL, Sukacita, Damai Sejahtra & Kasih Sayang ALLAH jadi bagian kita selalu... Salam: Steven, Ansye, Benaya & Samuel.', 0),
(7, 'C:/cygwin/var/spool/sms/incoming/GSM1.0B5ysz', '6285697478335', '2010-12-23 20:10:48', '2011-01-11 21:41:07', 0, '         ,?,        ,::*:,      ,;*;Y;*;,      ..'';*;)*;''..      ___)(____ Natal sdh tiba.. Kidung Natal sdh terdengar di mana2..  siapknlah PALUNGAN HATI kita utk menyambut kedatangan YESUS, sbg RAJA dan HAKIM yg ADIL dan AGUNG.\r Bukan sbg Bayi yg mungil.', 0),
(10, 'C:/cygwin/var/spool/sms/incoming/GSM1.0C5Gbk', '6285231311953', '2010-12-25 06:46:47', '2011-01-11 20:30:47', 0, ' Seiring waktu  bersama dg dentang bel berbunyi tanda bahwa NATAL telah tiba ,JURU SELAMAT DUNIA TELAH TIBA ,hari bahagai penuh sukacita bagi umat manusia didunia untuk menyambutnya.Kami skluarga mengucapkan SELAMAT HARI NATAL  2010 & menyongsong Tahun Baru 2011, Semoga damai sejahtera , berkat karuniaNYA melingkupi kita sekeluarga.AMIN GBu dr P Hans + B Ivon sklg', 0),
(13, 'C:/cygwin/var/spool/sms/incoming/GSM1.0ESNGw', '6285697478335', '2010-12-22 12:48:33', '2011-01-11 20:28:40', 0, ' Seorg saudara meinginkan yg terbaik  Seorg sahabat menginginkan kesetiaan  Seorg kekasih menginginkan kesempurnaanmu  TETAPI  TUHAN ingin kita tulus apa adanya.', 0),
